Templates.template:
modifySelectionBehaviour(
	"${oPayload}", // object
	"${oContent}", // sap.ui.mdc.valuehelp.base.FilterableListContent
	{
		type: ${type}, // sap.ui.mdc.enum.SelectType
		conditions: [${conditions}] // object[]
	}
)

fireInnerChartLoadedData(
	{
		innerChart: ${innerChart} // sap.ui.core.Control
	}
)

fireSelectionDetailsActionPressed(
	{
		action: ${action}, // sap.ui.core.Item
		itemContexts: ${itemContexts}, // sap.ui.model.Context
		level: ${level} // sap.m.SelectionDetailsActionLevel
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		promise: ${promise} // Promise
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		conditions: [${conditions}], // object[]
		promise: ${bPromise} // boolean
	}
)

fireChange(
	{
		items: [${items}], // sap.ui.mdc.field.MultiValueFieldItem[]
		valid: ${bValid}, // boolean
		promise: ${promise} // Promise
	}
)

fireBeforeExport(
	{
		exportSettings: ${exportSettings}, // object
		userExportSettings: ${userExportSettings} // object
	}
)

firePaste(
	{
		data: [${data}] // string[][]
	}
)

fireRowPress(
	{
		bindingContext: ${bindingContext} // sap.ui.model.Context
	}
)

fireSelectionChange(
	{
		bindingContext: ${bindingContext}, // sap.ui.model.Context
		selected: ${bSelected}, // boolean
		selectAll: ${bSelectAll} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}" // string
	}
)

fireSelect(
	{
		conditions: [${conditions}], // object[]
		add: ${bAdd}, // boolean
		close: ${bClose} // boolean
	}
)

new sap.ui.mdc.condition.RangeOperator(
	{
		label: "${label}", // string
		calcRange: ${fn_calcRange}, // function
		formatRange: ${fn_formatRange}, // function
		defaultValues: [${defaultValues}] // int[]|function
	}
)

fireSelect(
	{
		key: "${key}" // string
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}" // string
	}
)

fireRequestDelegateContent(
	{
		contentId: "${contentId}" // string
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enum.SelectType
		conditions: [${conditions}] // object[]
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireNavigated(
	{
		leaveFocus: ${bLeaveFocus}, // boolean
		condition: ${condition}, // object
		itemId: "${itemId}" // string
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enum.SelectType
		conditions: [${conditions}] // object[]
	}
)

fireConfirm(
	{
		close: ${bClose} // boolean
	}
)

fireSelect(
	{
		type: ${type}, // sap.ui.mdc.enum.SelectType
		conditions: [${conditions}] // object[]
	}
)

fireLiveChange(
	{
		value: "${value}", // string
		escPressed: ${bEscPressed}, // boolean
		previousValue: "${previousValue}" // string
	}
)

fireSubmit(
	{
		promise: ${promise} // Promise
	}
)

fireNavigate(
	{
		value: ${value}, // any
		key: ${key}, // any
		condition: ${condition}, // object
		itemId: "${itemId}", // string
		leaveFocus: ${bLeaveFocus} // boolean
	}
)

fireSelect(
	{
		conditions: [${conditions}], // object[]
		add: ${bAdd}, // boolean
		close: ${bClose} // boolean
	}
)

fireDataUpdate(
	{
		contentChange: ${bContentChange} // boolean
	}
)

fireNavigate(
	{
		key: ${key}, // any
		description: "${description}", // string
		leave: ${bLeave}, // boolean
		disableFocus: ${bDisableFocus}, // boolean
		itemId: "${itemId}" // string
	}
)

fireSelectionChange(
	{
		selectedItems: [${selectedItems}], // object[]
		itemPress: ${bItemPress} // boolean
	}
)

new sap.ui.mdc.field.FieldValueHelpMTableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.m.Table
	}
)

new sap.ui.mdc.field.FieldValueHelpMdcTableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.ui.mdc.Table
	}
)

new sap.ui.mdc.field.FieldValueHelpUITableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.ui.table.Table
	}
)

enhanceXConfig(
	"${vControl}", // sap.ui.mdc.Control
	{
		name: ${name}, // object
		controlMeta: ${controlMeta}, // object
		value: ${value}, // object
		propertyBag: ${propertyBag} // object
	}
)

getArrayDeltaChanges(
	{
		existingState: [${existingState}], // array
		changedState: [${changedState}], // array
		control: ${control}, // object
		changeOperations: ${changeOperations}, // object
		generator: "${generator}" // string
	}
)

firePress(
	{
		bindingContext: ${bindingContext} // sap.ui.model.Context
	}
)
